import React, { Component } from "react";
import PropTypes from "prop-types";

export class Detalles extends Component {
  static propTypes = {
    id: PropTypes.string
  };

  componentDidMount() {
    const { id } = this.props;

    this.buscarPelocula(id);
  }

  buscarPelocula(id) {}

  render() {
    return <p>{this.props.id}</p>;
  }
}
